import React from 'react';
import { NavLink, useLocation } from 'react-router-dom';

function Navbar({ onOpenLoginForm }) {
  const location = useLocation();

  return (
    <div className="navbar-container">
      {/* ... outros conteúdos da Navbar ... */}
      <ul className="nav-menu">
        <li className="nav-item">
          <NavLink to="/" className={`nav-link ${location.pathname === '/' ? 'active' : ''}`}>
            {/* ... conteúdo do link ... */}
          </NavLink>
        </li>
        <li className="nav-item">
          <NavLink to="/listagem" className={`nav-link ${location.pathname === '/listagem' ? 'active' : ''}`}>
            {/* ... conteúdo do link ... */}
          </NavLink>
        </li>
        <li className="nav-item">
          <a className="nav-link">
            <button className="loginbtn" id="toggleButton" onClick={onOpenLoginForm}>
              Login - Cadastro
            </button>
            {/* ... outros conteúdos ... */}
          </a>
        </li>
      </ul>
    </div>
  );
}

export default Navbar;
